import React from 'react';
import { Link } from 'react-router-dom';
import Menu from './Menu';
import './styles/Header.css';

const Header = () => (
    <Navbar bg="dark" variant="dark">
    <Navbar.Brand>
      Navbar with a black bg and white text
    </Navbar.Brand>
</Navbar>
);

export default Header;
